import React, { useState } from "react";
import { Navbar, Footer } from "./CommonUI";
import "../css/admindashboard.css";

const AdminDashboard = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const [isDarkMode, setIsDarkMode] = useState(false);

  // ‚úÖ Admin is logged in
  const isLoggedIn = true;

  const toggleSidebar = () => setSidebarOpen(!sidebarOpen);
  const toggleDarkMode = () => setIsDarkMode(!isDarkMode);

  // Dummy data
  const totalUsers = 1200;
  const totalQuestions = 350;

  const dummyQuestions = [
    { id: 1, question: "What is 5 + 3?", options: ["6", "7", "8", "9"], correct: "8", category: "Quantitative" },
    { id: 2, question: "Which word is opposite of 'Happy'?", options: ["Sad", "Joyful", "Glad", "Pleased"], correct: "Sad", category: "Verbal" },
    { id: 3, question: "Which planet is known as the Red Planet?", options: ["Venus", "Earth", "Mars", "Jupiter"], correct: "Mars", category: "GK" },
    { id: 4, question: "Find the next number: 2, 4, 8, 16, ?", options: ["18", "20", "24", "32"], correct: "32", category: "Logical" },
    { id: 5, question: "What is the capital of Japan?", options: ["Seoul", "Beijing", "Tokyo", "Bangkok"], correct: "Tokyo", category: "GK" },
    { id: 6, question: "What comes next: A, C, E, G, ?", options: ["I", "J", "H", "K"], correct: "I", category: "Reasoning" },
    { id: 7, question: "Which one is a prime number?", options: ["4", "6", "9", "11"], correct: "11", category: "Quantitative" },
    { id: 8, question: "Synonym of 'Brave'?", options: ["Cowardly", "Courageous", "Weak", "Fearful"], correct: "Courageous", category: "Verbal" },
    { id: 9, question: "Which is not a programming language?", options: ["Python", "HTML", "C++", "Java"], correct: "HTML", category: "GK" },
    { id: 10, question: "If 3x = 12, what is x?", options: ["2", "3", "4", "6"], correct: "4", category: "Quantitative" },
  ];

  return (
    <div className="admin-dashboard">
      {/* Navbar */}
      <Navbar
        isDarkMode={isDarkMode}
        toggleDarkMode={toggleDarkMode}
        isLoggedIn={isLoggedIn}
      />

      <div className="main-section">
        {/* Sidebar */}
        <div className={`sidebar ${sidebarOpen ? "open" : ""}`}>
          <button className="sidebar-toggle" onClick={toggleSidebar}>
            {sidebarOpen ? "Close" : "‚â°"}
          </button>

          {sidebarOpen && (
            <div className="sidebar-content">
              <h4>Profile</h4>
              <p><strong>Name:</strong> Admin Name</p>
              <p><strong>Email:</strong> admin@example.com</p>
              <p><strong>Role:</strong> Admin</p>
            </div>
          )}
        </div>

        {/* Dashboard Content */}
        <div className="dashboard-content">
          <h1>Admin Dashboard</h1>
          <p>Welcome, Admin! Here you can manage users, view reports, and handle system settings.</p>

          {/* Overview */}
          <section className="overview-section">
            <h2>üìä Overview Dashboard</h2>
            <div className="overview-cards">
              <div className="card">
                <h3>Total Users Registered</h3>
                <p>{totalUsers}</p>
              </div>
              <div className="card">
                <h3>Total Questions</h3>
                <p>{totalQuestions}</p>
              </div>
            </div>
          </section>

          {/* Question Management */}
          <section className="management-section">
            <h2>üßë‚Äçüè´ Question Management</h2>
            <div className="table-wrapper">
              <table className="question-table">
                <thead>
                  <tr>
                    <th>#</th>
                    <th>Question</th>
                    <th>Option A</th>
                    <th>Option B</th>
                    <th>Option C</th>
                    <th>Option D</th>
                    <th>Correct</th>
                    <th>Category</th>
                    <th>Edit</th>
                    <th>Delete</th>
                  </tr>
                </thead>
                <tbody>
                  {dummyQuestions.map((q, index) => (
                    <tr key={q.id}>
                      <td>{index + 1}</td>
                      <td>{q.question}</td>
                      <td>{q.options[0]}</td>
                      <td>{q.options[1]}</td>
                      <td>{q.options[2]}</td>
                      <td>{q.options[3]}</td>
                      <td>{q.correct}</td>
                      <td>{q.category}</td>
                      <td><button className="edit-btn">Edit</button></td>
                      <td><button className="delete-btn">Delete</button></td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </section>
        </div>
      </div>

      {/* Footer */}
      <Footer />
    </div>
  );
};

export default AdminDashboard;
